import React from 'react';
import clsx from 'clsx';
import PropTypes from 'prop-types';
import Checkbox from '@material-ui/core/Checkbox';
import Grid from '@material-ui/core/Grid';
// import TextField from '@material-ui/core/TextField';
// import { borders } from '@material-ui/system';
// import Container from '@material-ui/core/Container';
import {
  Container,
  Card,
  CardHeader,
  Divider,
  FormControlLabel,
  makeStyles,
  Box,
} from '@material-ui/core';

const useStyles = makeStyles(() => ({
  root: {
    display: 'flex',
    height: '100%',
    with: '100%'
  }
}));

const TrafficByDevice = ({ className, ...rest }) => {
  const classes = useStyles();
  // const theme = useTheme();
  const [checked, setChecked] = React.useState(true);

  const handleChange = (event) => {
    setChecked(event.target.checked);
  };
  const handleChange1 = (event) => {
    setChecked(event.target.checked);
  };

  return (
    <Container fixed>
      <Card className={clsx(classes.root, className)} {...rest}>
        <Grid container spacing={3}>
          <Grid item xs={12}>
            <CardHeader title="Inbox" />
            <Box borderBottom={1} display="flex" flexDirection="row">
              {/* <CardHeader title="Inbox" /> */}
              <Checkbox
                inputProps={{ 'aria-label': 'primary checkbox' }}
              />
              {/* <TextField defaultValue="Hello World" /> */}
              <Box mt={1}>
                <div>
                  This divs text looks like that of a button.
                </div>
              </Box>
            </Box>
          </Grid>
          <Grid item xs={12}>
            <Box borderBottom={1} display="flex" flexDirection="row">
              <Checkbox
                inputProps={{ 'aria-label': 'primary checkbox' }}
              />
              <Box mt={1}>
                <div>
                  This divs text looks like that of a button.
                </div>
              </Box>
            </Box>
          </Grid>
          <Grid item xs={12}>
            <Box borderBottom={1} display="flex" flexDirection="row">
              <Checkbox
                inputProps={{ 'aria-label': 'primary checkbox' }}
              />
              <Box mt={1}>
                <div>
                  This divs text looks like that of a button.
                </div>
              </Box>
            </Box>
          </Grid>
          <Grid item xs={12}>
            <Box borderBottom={1} ml={2} display="flex" flexDirection="row">
              <FormControlLabel
                control={<Checkbox />}
                label="Push Notifications"
              />
            </Box>
          </Grid>
          <Grid item xs={12}>
            <Box borderBottom={1} display="flex" flexDirection="row">
              <Checkbox
                checked={checked}
                onChange={handleChange}
                inputProps={{ 'aria-label': 'primary checkbox' }}
              />
              <Box mt={1}>
                <div>
                  This divs text looks like that of a button.
                </div>
              </Box>
            </Box>
          </Grid>
          <Grid item xs={12}>
            <Box borderBottom={1} display="flex" flexDirection="row">
              <Checkbox
                checked={checked}
                onChange={handleChange1}
                inputProps={{ 'aria-label': 'primary checkbox' }}
              />
              <Box mt={1}>
                <div>
                  This divs text looks like that of a button.
                </div>
              </Box>
            </Box>
          </Grid>

          <Divider />
        </Grid>
      </Card>
    </Container>
  );
};

TrafficByDevice.propTypes = {
  className: PropTypes.string
};

export default TrafficByDevice;
